import React from "react";
import "./dashboard.css"


const Redflags = ({article}) => {
  const {  title, user, topic, created_at, story, time} = article;




  return(
    <>
<div className="redflags">
<h3>Red flags</h3>
<img className='profile_image' src={user.profile_image} alt='DP' />
        <h4 className='username'>{user.username}</h4>
        <p className='date_created'>â€¢ {created_at.substring(0, 10)}</p>
      </div>
      <div className='content'>
        <h3 className='title'>{title}</h3>
        <p className='story'>{story}...</p>
        <p className='story'>{topic}...</p>
        <p className='story'>{time}...</p>
      </div>
      <div className='btns'>
        <button className='btn'></button>
        <button className='btn'></button>

<button className="delete">delete</button>
<button className="delet">edit</button>
</div>
</>
  );
}
const Interventions = () => {
  return(
<>
<div className="intervene">
<h3>Interventions</h3>
<button className="delete">delete</button>
<button className="delet">edit</button>
</div>
</>
  );
}
const Dashboard = () => {

  return (
   <div>
<h2>Your Records</h2>
      <Redflags />
      <Interventions />
    </div>         
  );
};

export default Dashboard;
